import { createContext } from "react";

export const WorkoutsConstext = createContext()

const WorkoutsContextProvider = ({ children }) => {
    return (
        <WorkoutsContext.Provider value={{workouts: []}}>
            { children }
        </WorkoutsContext.Provider>
    )
}
